(1, 'WHAT THEY SEE  ', 0, 'what-they-see', '&lt;p&gt;Growing up as a young adult has been especially intriguing. Being fascinated about a lot of things, wanting to try out new things, know what it feels like, test your limits, break all the rules and do whatever you want.&lt;/p&gt;\n&lt;p&gt;', '', '1', '2', '', 'null', '2016-07-07 00:00:00', 'autosave', 1, '2016-10-04 18:32:56', 0, 'f57bfb7d8f7b1445c324fd0914462be5'),
(2, 'Cannons in the skyr', 0, 'cannons-in-the-skyr', '&lt;p&gt;up as a you&lt;span style=&quot;text-decoration: line-through;&quot;&gt;nGrowing g adult has been especially int&lt;/span&gt;riguing. Being fascinated about a lot of things, wanting to try out new things, know what it feels like, test your limits, break all the rules and do whatever you want.&lt;/p&gt;\n&lt;p&gt;By design, we were all placed in families, and there is a reason for that. The reason affects both parties: the child brings joy to the parents, the parents provide guidance and necessary provisions for the child\'s welfare.&lt;/p&gt;\n&lt;p&gt;A time comes when young adults feel they have lived a long time :) . They now know the system, have tried the system and can wiggle their way through it. They know the rules and now, they want to write theirs!&lt;/p&gt;\n&lt;p&gt;', '', '2', '2', '', 'null', '2016-07-07 00:00:00', 'publish', 1, '2016-07-07 12:47:04', 0, '3086999a53ccb4cd945f8b38ba00279a'),
