(26, 'Let\'s end it here', 20160926, 'lets-end-it-here', '<h1><span class=\"objectBox objectBox-text \">This is a story <strong>of a Great King&nbsp;</strong></span></h1>\r\n<p><span class=\"objectBox objectBox-text \"><strong>Very roughly, most firms that are not yet factoring the Internet into<br />their business vision and priorities and have only a limited Web presence<br />need to be focusing on the first problem. The management question for<br />them is, Are we in or out of the value game? Those that are more committed<br />and active in the Web arena need to ask if they really do have a business<br />model or are just in the .com mode of thinking. The third problem&mdash;What<br />can and should our business model be?&mdash;is the one for companies to address in order to move along the value path toward .profit rather than just<br />meander around the Internet marketspace</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'new_image_path', '1', '4', 'Life in the military', '1,8', '2016-10-04 21:02:54', 'autosave', 1, '2016-10-04 20:02:54', 0, 'c42f7f1f64565de13c5f6e8f0e4a7e09'),
(27, 'When it matter\'s most', 20161006, 'when-it-matters-most', '<h3>Pinout! The comprehensive GPIO Pinout guide for the Raspberry Pi.</h3>\r\n<p>This GPIO Pinout is designed to be both a quick, interactive reference to the Raspberry Pi GPIO pins, plus a comprehensive guide to your Raspberry Pi\'s GPIO interfaces. It also includes dozens of pinouts for Raspberry Pi add-on boards, HATs and pHATs.</p>\r\n<h2>Latest Pinout news</h2>\r\n<p>We\'ve <a href=\"http://pinout.xyz/boards\">added a board explorer</a>! Use it to find the pinout for a Raspberry Pi add-on board, or discover new ones. If you manufacture boards, we\'d love to add yours too. <a href=\"https://github.com/gadgetoid/Pinout2\">You can contribute over on GitHub</a>.</p>', 'take_all_5.jpg', '1', '2', '', '1,2,3,4,5,14', '2016-10-06 00:08:25', 'publish', 1, '2016-10-05 23:08:26', 0, '4e9ffc44c03acebd83598fb23b1bf575'),
(28, 'Once upon a time in china', 20161006, 'once-upon-a-time-in-china', '<h3>Pinout! The comprehensive GPIO Pinout guide for the Raspberry Pi.</h3>\r\n<p>This GPIO Pinout is designed to be both a quick, interactive reference to the Raspberry Pi GPIO pins, plus a comprehensive guide to your Raspberry Pi\'s GPIO interfaces. It also includes dozens of pinouts for Raspberry Pi add-on boards, HATs and pHATs.</p>\r\n<h2>Latest Pinout news</h2>\r\n<p>We\'ve <a href=\"http://pinout.xyz/boards\">added a board explorer</a>! Use it to find the pinout for a Raspberry Pi add-on board, or discover new ones. If you manufacture boards, we\'d love to add yours too. <a href=\"https://github.com/gadgetoid/Pinout2\">You can contribute over on GitHub</a>.</p>\r\n<p>&nbsp;</p>\r\n<p>Nothing to change here</p>', 'combatants.jpg', '1', '2', '', '3,5,34,41,47,56', '2016-10-06 00:53:17', 'publish', 1, '2016-10-05 23:53:18', 0, 'd31a4de94f48adb6790de758bc709c49'),
(29, 'About Heaven on earth', 20161006, 'about-heaven-on-earth', '<h3>Pinout! The comprehensive GPIO Pinout guide for the Raspberry Pi.</h3>\r\n<p>This GPIO Pinout is designed to be both a quick, interactive reference to the Raspberry Pi GPIO pins, plus a comprehensive guide to your Raspberry Pi\'s GPIO interfaces. It also includes dozens of pinouts for Raspberry Pi add-on boards, HATs and pHATs.</p>\r\n<h2>Latest Pinout news</h2>\r\n<p>We\'ve <a href=\"http://pinout.xyz/boards\">added a board explorer</a>! Use it to find the pinout for a Raspberry Pi add-on board, or discover new ones. If you manufacture boards, we\'d love to add yours too. <a href=\"https://github.com/gadgetoid/Pinout2\">You can contribute over on GitHub</a>.</p>', 'bush_excersize.jpg', '1', '2', '', '3', '2016-10-06 00:39:08', 'autosave', 1, '2016-10-05 23:39:08', 0, '444dfbb05ef989373e7eb2efb162268d'),
