(31, 'Just for laughs', 20161007, 'just-for-laughs', '&lt;p&gt;That &amp;rsquo;s i t , just three l ines of code not count ing the import statement that i s real ly part of the&lt;br /&gt;program ini t ial izat ion. You should create the code in the nano edi tor and save i t wi th a name that&lt;br /&gt;makes sense. I saved mine as Pin18_Test .py. Remember to use the .py suffix, since IDLE checks i t to&lt;br /&gt;ensure that i t i s a val id Python program.&lt;br /&gt;You need to open and run thi s program in the Python shel l . However, there i s an important act ion&lt;br /&gt;that you need to take or Python wi l l complain and not run the program. You must run IDLE at the root&lt;br /&gt;level , not at a &amp;ldquo;normal&amp;rdquo; user level . Thi s i s needed, I bel ieve, because the GPIO l ibrary i s accessing&lt;br /&gt;Linux funct ions or resources that can only be accessed as root . Do the fol lowing to run the IDLE&lt;br /&gt;Linux shel l as root :&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;That &amp;rsquo;s i t , just three l ines of code not count ing the import statement that i s real ly part of the&lt;br /&gt;program ini t ial izat ion. You should create the code in the nano edi tor and save i t wi th a name that&lt;br /&gt;makes sense. I saved mine as Pin18_Test .py. Remember to use the .py suffix, since IDLE checks i t to&lt;br /&gt;ensure that i t i s a val id Python program.&lt;br /&gt;You need to open and run thi s program in the Python shel l . However, there i s an important act ion&lt;br /&gt;that you need to take or Python wi l l complain and not run the program. You must run IDLE at the root&lt;br /&gt;level , not at a &amp;ldquo;normal&amp;rdquo; user level . Thi s i s needed, I bel ieve, because the GPIO l ibrary i s accessing&lt;br /&gt;Linux funct ions or resources that can only be accessed as root . Do the fol lowing to run the IDLE&lt;br /&gt;Linux shel l as root :&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;That &amp;rsquo;s i t , just three l ines of code not count ing the import statement that i s real ly part of the&lt;br /&gt;program ini t ial izat ion. You should create the code in the nano edi tor and save i t wi th a name that&lt;br /&gt;makes sense. I saved mine as Pin18_Test .py. Remember to use the .py suffix, since IDLE checks i t to&lt;br /&gt;ensure that i t i s a val id Python program.&lt;br /&gt;You need to open and run thi s program in the Python shel l . However, there i s an important act ion&lt;br /&gt;that you need to take or Python wi l l complain and not run the program. You must run IDLE at the root&lt;br /&gt;level , not at a &amp;ldquo;normal&amp;rdquo; user level . Thi s i s needed, I bel ieve, because the GPIO l ibrary i s accessing&lt;br /&gt;Linux funct ions or resources that can only be accessed as root . Do the fol lowing to run the IDLE&lt;br /&gt;Linux shel l as root :&lt;/p&gt;', 'Nonso_Okafor_Wife_20160107_110819_1.jpg', '2', '2', 'Him who laughs last', '2,4,16,20', '2016-10-07 13:58:55', 'publish', 1, '2016-10-07 12:58:56', 0, '551a55375e4709207660e8b2bd48ce22'),
(32, 'Janes Henry briefing', 20170626, 'janes-henry-briefing', '&lt;p&gt;In\r\nthe 21st century, more students have caught themselves in the\r\nplethora of social media, networking amongst many others. Most student groups\r\nin your school/ business environment have Facebook pages, WhatsApp groups\r\namongst the myriad of social networking communities we have in existence today.\r\n\r\n&lt;p&gt;Online\r\ncommunication through such medium, more often than not, take precedence over\r\nphysical meetings, due to its inherent advantages. This is the leverage that\r\nthe myUNIZIK Software bring to management of the hostel within the university\r\ncommunity.&lt;/p&gt;\r\n\r\n&lt;p&gt;The\r\nmyUNIZIK Hostel Management Software system will facilitate &lt;/p&gt;\r\n\r\n&lt;p&gt;1. &amp;nbsp; &amp;nbsp;\r\nEasy and intuitive hostel\r\napplication processes and room selection.&lt;/p&gt;\r\n\r\n&lt;p&gt;2. &amp;nbsp; &amp;nbsp;\r\nItâ€™s\r\nvery large database is used for storage and retrieval of various student data\r\n(hence illegal occupants can be easily identified), which includes&lt;/p&gt;\r\n\r\n&lt;p&gt;a. &amp;nbsp; &amp;nbsp;\r\nAcademic/Education\r\nRecords of Hostel Occupants&lt;/p&gt;\r\n\r\n&lt;p&gt;b. &amp;nbsp; &amp;nbsp;\r\nFinancial\r\nInformation and Status &lt;/p&gt;\r\n\r\n&lt;p&gt;c. &amp;nbsp; &amp;nbsp; \r\nRelational\r\nInformation of the Student (Next of Kin or Sponsor)&lt;/p&gt;\r\n\r\n&lt;p&gt;3. &amp;nbsp; \r\nManage\r\nRooms and their occupancy by making available information about&lt;/p&gt;\r\n\r\n&lt;p&gt;a. &amp;nbsp; &amp;nbsp;\r\nAll\r\nRooms and their spaces.&lt;/p&gt;\r\n\r\n&lt;p&gt;b. &amp;nbsp; \r\nAll\r\nVacant Rooms.&lt;/p&gt;\r\n\r\n&lt;p&gt;c. &amp;nbsp; &amp;nbsp;\r\nAll\r\nOccupied Rooms&lt;/p&gt;\r\n\r\n&lt;p&gt;d. &amp;nbsp; \r\nAll\r\nRooms occupied but not totally filled (Rooms with vacant spaces)&lt;/p&gt;\r\n\r\n&lt;p&gt;4. &amp;nbsp; &amp;nbsp;\r\nSecured\r\nAccess to the Software: Login security and verification&lt;/p&gt;\r\n\r\n&lt;h1&gt;Hostel\r\nApplication and Processes&lt;/h1&gt;\r\n\r\n&lt;h2&gt;Step 1&lt;/h2&gt;\r\n\r\n&lt;p&gt;Online\r\nweb forms at the myUNIZIK site is used to collect the\r\nuser information. From the websiteâ€™s home page (&lt;a target=&quot;_blank&quot; rel=&quot;nofollow&quot; href=&quot;http://www.myUNIZIK.com.ng&quot;&gt;www.myUNIZIK.com.ng&lt;/a&gt;) all available hostels are listed or one can do a search for the\r\nparticular hostel of choice or follow a specified URL: &lt;a href=&quot;http://www.myUNIZIK.com.ng/university-lodge&quot;&gt;www.myUNIZIK.com.ng/university-lodge&lt;/a&gt;.\r\nThis is the first contact each and every student who desires a room in the\r\nhostel comes in contact with.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Step 2&lt;/h2&gt;\r\n\r\n&lt;p&gt;On this homepage the hostel is listed out,\r\nand provision is made for the applicant to choose amongst the available\r\n(vacant) rooms. Note that once a room/room space is filled it is automatically\r\ndelisted from the availability list.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Step 3&lt;/h2&gt;\r\n\r\n&lt;p&gt;Once the choice of room has been made, it\r\nprompts the user for his details: Personal information, Education Information,\r\nNext of Kin, etc., and then allows the user to specify his own login\r\ncredentials with which he would be able to use to access the site.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Step 4&lt;/h2&gt;\r\n\r\n&lt;p&gt;The system validates the information it has\r\nbeen given and processes them if correct, else, it request the user to make the\r\nnecessary corrections. If all corrections have been done, and no error was\r\nfound, the system saves this information for the management/ administrator.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Step 5&lt;/h2&gt;\r\n\r\n&lt;p&gt;The room balloting system is implemented to\r\ndynamically assign rooms to all (or some) the applicants on a first come, first\r\nserve basis. This is done in a free and fair manner.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Step 6&lt;/h2&gt;\r\n\r\n&lt;p&gt;The next step in completing the application, is\r\nto make the financial transaction through the specified means within a\r\nspecified period of time. If this financial transaction is not completed within\r\nthe specified period of time, the applicantâ€™s application is marked as stale,\r\nand the room reassigned to someone else. This is done automatically.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Step 7&lt;/h2&gt;\r\n\r\n&lt;p&gt;Once financial transaction has been\r\nauthenticated by the administrator, this system will generate a receipt\r\nautomatically for the applicants, which means the applicant has successfully\r\nacquired the room for the period of time specified.&lt;/p&gt;\r\n\r\n&lt;h2&gt;The Student and\r\nthe Administrator&lt;/h2&gt;\r\n\r\n&lt;p&gt;So\r\nas not to bore you with such technical jargons such as front end and back end,\r\nwe will simply define it as this: The &lt;b&gt;front\r\nend&lt;/b&gt; is what is visible to the general public (the student/ university\r\ncommunity), where you can make an application for the room in any hostel, etc.\r\nThe &lt;b&gt;back end&lt;/b&gt; on the other hand is\r\nusually restricted to the management and administered by the Administrator.&lt;/p&gt;\r\n\r\n\r\n\r\n\r\n\r\nï»¿&lt;br&gt;&lt;/p&gt;', 'learn-ai.JPG', '1', '23', 'When tech sucks', '73,75,79,80,81,82', '2017-06-26 19:08:44', 'publish', 1, '2017-06-26 18:08:44', 0, '6d31496d2ba31a2c603b1984a98992f9'),
