INSERT INTO `photo_gallery` (`id`, `image`, `head`, `description`, `date`) VALUES
(1, '18-Get_Creative.jpg', 'Our Vision', 'Our vision was to use Digital technology to transform our evangelism and follow-up processes for all new converts and members of the church. To free our workers from slow and inflexible paper processes, and replacing paper processes with digital processes that liberates workers to do productive work.', '2016-10-20 10:45:08'),
(2, '38-Be_Tender.jpg', 'Our Mission', 'To radiate love and caring, Our vision was to use Digital technology to transform our evangelism and follow-up processes for all new converts and members of the church. To free our workers from slow and inflexible paper processes.', '2016-10-20 10:46:09'),
(5, '41-Beware_Alternative_Medicine.jpg', 'Our Values', 'Our vision was to use Digital technology to transform our evangelism and follow-up processes for all new converts and members of the church. To free our workers from slow and inflexible paper processes, and replacing paper processes with digital processes that liberates workers to do productive work.', '2016-10-20 10:46:50'),
(6, '58-Protect_Your_Kids.jpg', 'Our Dream', 'Our vision was to use Digital technology to transform our evangelism and follow-up processes for all new converts and members of the church. To free our workers from slow and inflexible paper processes, and replacing paper processes with digital processes that liberates workers to do productive work.', '2016-10-20 10:47:34'),
(7, '60-Work_Hard.jpg', 'Our Success', 'Our vision was to use Digital technology to transform our evangelism and follow-up processes for all new converts and members of the church. To free our workers from slow and inflexible paper processes, and replacing paper processes with digital processes that liberates workers to do productive work.', '2016-10-20 10:48:31'),
(8, '82-Read_More.jpg', 'Our Mandate', 'Academics, live, study, and everything in between.  More than any other financial principle, credit has dominated the\r\nway we do business in our generation. In 1929 the entire country, and\r\nindeed  the  world,  was  shaken  to  its  core  by  the  collapse  of  our\r\nfinancial base. Millions of people were displaced as businesses failed\r\nand  banks  closed.', '2016-10-20 12:56:50');
